Blockly.Msg.TOUR1_DESCRIPTION01 = "Welcome,<br>click on  »next« and start a tour through the Open Roberta Lab.<br>I'll show you how you can program your robot with NEPO.<br>You can end this tour all the time with a click on »X« in the right upper corner.";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION02 = "El menu ;-)";
Blockly.Msg.TOUR1_DESCRIPTION03 = "Here you can find everything you need to program the robot!<br><span class='typcn typcn-document-text'></span> Save and load programs<br><span class='typcn typcn-ev3'></span> Connect your robot to the Open Roberta Lab or switch to another system<br><span class='typcn typcn-lightbulb'></span> Help for all kinds of problems<br><span class='typcn typcn-user'></span>Everything about user accounts, e.g. login or logoff<br><span class='typcn typcn-th-large-outline'></span> Look at the gallery and try great programs from other users!<br><span class='typcn typcn-world'></span> Click here to switch to another language";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION04 = "Haz clic aquí y cambia a la configuración del robot.";
Blockly.Msg.TOUR1_DESCRIPTION05 = "You can adapt the robot configuration later,<br>if you've constructed another robot.<br>If you don't have a robot and want to test your program in the simulation <br>this configuration is applied.";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION06 = "¡Haz clic aquí y vuelve al área de programación!";
Blockly.Msg.TOUR1_DESCRIPTION07 = "La caja de herramientas.<br>Aquí encontrarás todos tus bloques de programación.";
Blockly.Msg.TOUR1_DESCRIPTION07a = "Once you are an experienced user you can switch here to the expert mode of the toolbox.<br>You will then find more blocks to program your robot.<br><span class='typcn typcn-media-stop-outline'></span> beginner mode<br><span class='typcn typcn-star-outline'></span> expert mode";  // untranslated
Blockly.Msg.TOUR1_DESCRIPTION08 = "Cada programa comieza con un boque inicio«.<br>Los demás bloques que el robot debe ejecutar se conectan con este bloque .<br>Simplemente arrastra el bloque deseado hasta justo debajo del bloque inicio,";
Blockly.Msg.TOUR1_DESCRIPTION09 = "Here you find some shortcuts!<br>From left to right:<br><span class='typcn typcn-media-play'></span> Click here to execute the program on the real robot<br><span class='typcn typcn-media-play-outline'></span> Click here to start the robot in the simulation<br><span class='typcn typcn-cloud-storage'></span> Save your program, but before that you need to sign in<br><span class='typcn typcn-zoom'></span> Click here and zoom in on the blocks, if you want to<br><span class='typcn typcn-archive'></span> The trashcan! Just move blocks into the trashcan and they will be deleted.<br>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Attention: You cannot recover blocks once they are deleted!<br>";
Blockly.Msg.TOUR1_DESCRIPTION10 = "Pulsa sobre »Acción«";
Blockly.Msg.TOUR1_DESCRIPTION12 = "Ahora arrastra el bloque justo debajo del bloque inicio para que conecten.";
Blockly.Msg.TOUR1_DESCRIPTION13 = "Ahora, abre la simulación ...";
Blockly.Msg.TOUR1_DESCRIPTION13a = "y prueba tu programa en la simulación!";
Blockly.Msg.TOUR1_DESCRIPTION15 = "Perfecto,<br>tu robot avanza 20 cm,<br> ¡exactamente lo que has programado!";
Blockly.Msg.TOUR1_DESCRIPTION16 = "Adios. ¡Diviértete probando más cosas!";
